  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Desoto
  National Wildlife Refuge outlines Refuge accomplishments during the 1990 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is also covered. The report includes a planning section which discusses
  the master plan, management planning, compliance with environmental and cultural
  resource mandates, and research and investigations. Refuge administration is outlined;
  information about personnel, youth programs, other manpower programs, volunteer
  programs, funding, safety, and technical assistance is given. Habitat management
  is also covered; subjects include wetlands, forests, croplands, grasslands, other
  habitat, haying, fire management, and pest control. The wildlife section of the
  report discusses wildlife diversity, endangered and threatened species, waterfowl,
  marsh birds and waterbirds, shorebirds, raptors, other migratory birds, game mammals,
  other resident wildlife, fisheries resources, scientific collections, animal control,
  and disease prevention and control. The public uses of the Refuge described in this
  report include outdoor classrooms, interpretive programs, hunting, fishing, wildlife
  observation, wildlife oriented recreation, picnicking, non-wildlife oriented recreation,
  law enforcement, and cooperating associations. The equipment and facilities section
  of the report provides information about new construction, rehabilitation, major
  maintenance, equipment utilization and replacement, communications systems, and
  computer systems. Cooperative programs, other economic uses, and items of interest
  are provided at the end. Photographs and Refuge brochures are attached.\",\n\t\"owner_org\":
